import styled from 'styled-components';

// 名前 = styled.要素名
const Header = styled.h1`
  display: flex;
  padding: 16px;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  align-items: center;
  width: 100%;
  background: rgb(51, 51, 51);
  color: white;
`;

const App = () => {
  return (
  <Header>
    Github Viewer
    </Header>
  )
};
export default App;
